import { 
    SET_STATE
 } from './actionTypes';

const DashboardReducer = (state, action) => {
    const { type, payload } = action;

    switch (type) {
        case SET_STATE:
            const { field, ...data } = payload;
            return {
                ...state,
                [field]: data,
            }
        default:
            return state;
    }
}

export default DashboardReducer;
